			line = br.readLine();
			
			while(line.equals("") || line.indexOf("*****")>-1 || line.indexOf("CONTRATANTE")>-1 ){
				if( line.indexOf("CONTRATANTE")>-1){
					datos[cont+1]=line.substring(0, line.length());
				}
				line = br.readLine();
			}
			
		
			datos[cont]=line.substring(0, line.length());
			cont++;
			
			
